import React from 'react';
import "./Header.css";
let home = './resources/home.png';
let math = './resources/math.png';
let science = './resources/science.png';
let accomplishments = './resources/accomplishments.png';
class Image extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <img class="Image" src={require(this.props.name)}></img>
        );
    }
}
class Header extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className="Header">
                <Image name={home}></Image>
                <Image name={math}></Image>
                <Image name={science}></Image>
                <Image name={accomplishments}></Image>
            </div>
        )
    }
}
export default Header;
